Мафия (ит. maf(f)ja, лат. maffia) - (по одной из версий) это тайное преступное сообщество, появившееся на Сицилии в конце IXX века. В широком смысле мафия – международная, тайная преступная организация, занимающаяся незаконной деятельностью и действующая методами шантажа, насилия, убийств и т. д.

 Мафию характеризует:

 - жесткая иерархия;
 - использование силы для поддержания внутренней дисциплины и для борьбы с конкуренцией;
 - собственная система ценностей и норм;
 - связь с политической и административной коррупцией;
 - использование легальных политических и административных учреждений для прикрытия и обеспечения нелегальной деятельности.

 В узком смысле - название этнического преступного сообщества, объединяющего главным образом выходцев из южной Италии.

 Изначально, мафия возникла для организации самообороны населения на острове Сицилия (Италия). Мафия противостояла правителям, которые много лет подавляли эту страну, покоряли железной рукой крестьян и пастухов. И орудием гнета в то время служила полиция. Измученные жители Сицилии уже тогда научились держать язык за зубами и никогда не проявлять своих эмоций, и не забывать, что общество это злейший враг. Люди никогда не искали справедливости у правительства, и поэтому всегда обращались к народной заступнице – мафии.

 В XX веке мафия установила свой контроль над преступным бизнесом (контрабандой, наркобизнесом, проституцией и т. п.), стала взаимодействовать с политическими структурами общества в Италии, а затем и в других странах. Отличительной чертой мафии является ее связь с пережитками родоплеменных обычаев, придающих мафии особую устойчивость и внутреннюю сплоченность. Например омерта, целью которой было запугивание и психологический контроль над рядовыми членами мафии. В настоящее время термин "Мафия" употребляется и как синоним организованной преступности.

 Согласно историку Паоло Пассино - "Мафия - организованное преступное сообщество, которое осуществляет функции суверенитета на определенной территории". 

 Многие исследователи видели мафию как ряд признаков, внедренных в популярную культуру, как "способ существования". Сицилийский этнограф, Джузеппе Питре в конце 19-ого века сказал о мафии следующее - "Мафия - сознание собственной ценности, преувеличенное понятие индивидуальной силы как единственный арбитр каждого конфликта, каждого столкновения интересов или идей".

 Сицилийцы не видели в этих людях преступников, наоборот мафиози - образцы для подражания и единственные защитники, при условии, когда государство не обеспечивает защитой своих граждан. Нередко мафия была единственным альтернативным правительством. Похоронная эпитафия легендарного босса Виллальбо, Кологеро Виззини, заявила уже в 1950-ых, что "его мафия не была преступна, поддерживала уважение закона, защиту прав, величие характера". В этом случае под словом "мафия" подразумевалось кое-что как гордость, честь, или даже социальная ответственность. Аналогично, в 1925 году, прежний итальянский Премьер-министр Витторио Эмануеле Орландо заявил в сенате, что он гордился тем, что он настоящий "Мафиозо", потому что слово "Мафиозо" означало благородный, щедрый.
